// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "../governance/AdminControl.sol";

contract PropertyMarket is ReentrancyGuard {
    // ========== 数据结构 ==========
    enum PropertyStatus { LISTED, RENTED, SOLD, DELISTED }
    
    struct PropertyListing {
        uint256 tokenId;
        address seller;
        uint256 price;
        address paymentToken;
        PropertyStatus status;
        uint256 listTimestamp;
        uint256 lastRenewed;
    }

    // ========== 状态变量 ==========
    AdminControl public immutable adminControl;
    IERC721 public immutable nftiContract;
    IERC721 public immutable nftmContract;
    
    mapping(uint256 => PropertyListing) public listings;
    mapping(address => mapping(uint256 => uint256)) public leaseTerms;

    // ========== 事件定义 ==========
    event NewListing(
        uint256 indexed tokenId,
        address indexed seller,
        uint256 price,
        address paymentToken
    );
    
    event PropertySold(
        uint256 indexed tokenId,
        address buyer,
        uint256 price,
        address paymentToken
    );
    
    event ListingUpdated(
        uint256 indexed tokenId,
        uint256 newPrice,
        address newPaymentToken
    );

    // ========== 构造函数 ==========
    constructor(
        address _adminControl,
        address _nftiAddress,
        address _nftmAddress
    ) {
        adminControl = AdminControl(_adminControl);
        nftiContract = IERC721(_nftiAddress);
        nftmContract = IERC721(_nftmAddress);
    }

    // ========== 核心功能 ==========
    function listProperty(
        uint256 tokenId,
        uint256 price,
        address paymentToken
    ) external nonReentrant {
        require(
            nftiContract.ownerOf(tokenId) == msg.sender,
            "Not NFTi owner"
        );
        
        require(
            adminControl.isKYCVerified(msg.sender),
            "KYC required"
        );
        
        require(price > 0, "Invalid price");

        listings[tokenId] = PropertyListing({
            tokenId: tokenId,
            seller: msg.sender,
            price: price,
            paymentToken: paymentToken,
            status: PropertyStatus.LISTED,
            listTimestamp: block.timestamp,
            lastRenewed: block.timestamp
        });

        emit NewListing(tokenId, msg.sender, price, paymentToken);
    }

    function purchaseProperty(
        uint256 tokenId,
        uint256 offerPrice
    ) external payable nonReentrant {
        PropertyListing storage listing = listings[tokenId];
        
        require(
            listing.status == PropertyStatus.LISTED,
            "Not available"
        );
        
        require(
            adminControl.isKYCVerified(msg.sender),
            "KYC required"
        );
        
        require(
            _validatePayment(listing.price, offerPrice, listing.paymentToken),
            "Payment failed"
        );

        _processPayment(
            listing.seller,
            listing.price,
            listing.paymentToken
        );

        nftiContract.transferFrom(
            listing.seller,
            msg.sender,
            tokenId
        );
        listing.status = PropertyStatus.SOLD;
        
        emit PropertySold(
            tokenId,
            msg.sender,
            listing.price,
            listing.paymentToken
        );
    }

    // ========== 支付处理函数 ==========
    function _validatePayment(
        uint256 listedPrice,
        uint256 offerPrice,
        address paymentToken
    ) private view returns (bool) {
        if (paymentToken == address(0)) {
            return msg.value >= listedPrice && offerPrice == listedPrice;
        } else {
            return offerPrice == listedPrice;
        }
    }

    function _processPayment(
        address seller,
        uint256 price,
        address paymentToken
    ) internal {
        (uint256 baseFee,, address feeCollector) = adminControl.feeConfig();
        uint256 fees = (price * baseFee) / 10000;
        uint256 netValue = price - fees;

        if (paymentToken == address(0)) {
            require(msg.value >= price, "Insufficient ETH");
            
            if (msg.value > price) {
                payable(msg.sender).transfer(msg.value - price);
            }
            
            payable(seller).transfer(netValue);
            payable(feeCollector).transfer(fees);
        } else {
            IERC20 token = IERC20(paymentToken);
            require(
                token.transferFrom(msg.sender, seller, netValue),
                "Transfer failed"
            );
            require(
                token.transferFrom(msg.sender, feeCollector, fees),
                "Fee transfer failed"
            );
        }
    }

    // ========== 管理功能 ==========
    function updateListing(
        uint256 tokenId,
        uint256 newPrice,
        address newPaymentToken
    ) external onlyOperator {
        PropertyListing storage listing = listings[tokenId];
        require(
            listing.status == PropertyStatus.LISTED,
            "Not active listing"
        );

        listing.price = newPrice;
        listing.paymentToken = newPaymentToken;
        listing.lastRenewed = block.timestamp;

        emit ListingUpdated(tokenId, newPrice, newPaymentToken);
    }

    // ========== 权限修饰符 ==========
    modifier onlyOperator() {
        bytes32 role = adminControl.OPERATOR_ROLE();
        require(
            adminControl.hasRole(role, msg.sender),
            "Operator required"
        );
        _;
    }

    // ========== 辅助功能 ==========
    function getListingDetails(uint256 tokenId)
        external
        view
        returns (
            address seller,
            uint256 price,
            address paymentToken,
            PropertyStatus status,
            uint256 listTimestamp
        )
    {
        PropertyListing storage listing = listings[tokenId];
        return (
            listing.seller,
            listing.price,
            listing.paymentToken,
            listing.status,
            listing.listTimestamp
        );
    }
}

contracts/governance/AdminControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract AdminControl is AccessControl, Pausable {
    using EnumerableSet for EnumerableSet.AddressSet;
    
    // ========== 角色权限定义 ==========
    bytes32 public constant OPERATOR_ROLE = keccak256("OPERATOR_ROLE");
    bytes32 public constant LEGAL_ROLE = keccak256("LEGAL_ROLE");
    bytes32 public constant REWARD_MANAGER = keccak256("REWARD_MANAGER");

    // ========== 手续费结构 ==========
    struct FeeSettings {
        uint256 baseFee;        // 基础交易费率（基点：100 = 1%）
        uint256 maxFee;         // 最大允许费率（基点）
        address feeCollector;   // 手续费接收地址
    }

    // ========== 奖励参数结构 ==========
    struct RewardParameters {
        uint256 baseRate;              // 基础奖励率（基点）
        uint256 communityMultiplier;   // 社区加成系数
        uint256 maxLeaseBonus;         // 最大租赁期限加成
        address rewardsVault;          // 奖励金库地址
    }

    // ========== 状态变量 ==========
    FeeSettings public feeConfig;
    RewardParameters public rewardParams;
    
    EnumerableSet.AddressSet private _kycVerified;
    mapping(address => uint256) public communityScores;
    mapping(uint256 => bool) public functionPaused;

    // ========== 事件定义 ==========
    event FeeConfigUpdated(uint256 newBaseFee, uint256 newMaxFee);
    event RewardParametersUpdated(uint256 newBaseRate, uint256 newMultiplier);
    event KYCStatusUpdated(address indexed account, bool status);
    function _initializeRoles(address admin) internal {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
        _grantRole(OPERATOR_ROLE, admin);
        _grantRole(LEGAL_ROLE, admin);
        _grantRole(REWARD_MANAGER, admin);
    }

    constructor(
        address initialAdmin,
        address feeCollector,
        address rewardsVault
    ) {
        require(initialAdmin != address(0), "Invalid admin address");
        
        // 初始化角色分配
        _initializeRoles(initialAdmin);

        // 初始化费用配置
        feeConfig = FeeSettings({
            baseFee: 200,       // 2%
            maxFee: 1000,       // 10%
            feeCollector: feeCollector
        });

        // 初始化奖励参数
        rewardParams = RewardParameters({
            baseRate: 1000,     // 10% 基础奖励
            communityMultiplier: 2000, // 20% 社区最大加成
            maxLeaseBonus: 300, // 3% 最大租赁加成
            rewardsVault: rewardsVault
        });
    }

    // ========== 手续费管理 ==========
    function updateFeeConfig(
        uint256 newBaseFee, 
        address newCollector
    ) external onlyRole(OPERATOR_ROLE) {
        require(newBaseFee <= feeConfig.maxFee, "Exceeds max fee");
        feeConfig.baseFee = newBaseFee;
        feeConfig.feeCollector = newCollector;
        emit FeeConfigUpdated(newBaseFee, feeConfig.maxFee);
    }

    // ========== KYC 管理 ==========
    function batchApproveKYC(
        address[] calldata accounts, 
        bool approved
    ) external onlyRole(LEGAL_ROLE) {
        for(uint i = 0; i < accounts.length; i++) {
            approved ? _kycVerified.add(accounts[i]) : _kycVerified.remove(accounts[i]);
            emit KYCStatusUpdated(accounts[i], approved);
        }
    }

    // ========== 奖励管理 ==========
    function configureRewards(
        uint256 newBaseRate,
        uint256 newMultiplier,
        uint256 newLeaseBonus
    ) external onlyRole(REWARD_MANAGER) {
        require(newBaseRate <= 2000, "Base rate >20%");
        require(newMultiplier <= 1500, "Multiplier >15%");
        require(newLeaseBonus <= 500, "Lease bonus >5%");

        rewardParams.baseRate = newBaseRate;
        rewardParams.communityMultiplier = newMultiplier;
        rewardParams.maxLeaseBonus = newLeaseBonus;
        
        emit RewardParametersUpdated(newBaseRate, newMultiplier);
    }

    // ========== 紧急控制 ==========
    function emergencyPauseFunction(
        uint256 functionId, 
        bool paused
    ) external onlyRole(DEFAULT_ADMIN_ROLE) {
        functionPaused[functionId] = paused;
    }

    function globalPause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function globalUnpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    // ========== 社区积分管理 ==========
    function updateCommunityScore(
        address user, 
        uint256 scoreDelta, 
        bool isAddition
    ) external onlyRole(OPERATOR_ROLE) {
        if(isAddition) {
            communityScores[user] += scoreDelta;
        } else {
            communityScores[user] = communityScores[user] > scoreDelta ? 
                communityScores[user] - scoreDelta : 0;
        }
    }

    // ========== 视图函数 ==========
    function getCurrentFee() external view returns (uint256) {
        return feeConfig.baseFee;
    }

    function isKYCVerified(address account) external view returns (bool) {
        return _kycVerified.contains(account);
    }

    function calculateRewards(
        address user, 
        uint256 baseAmount
    ) external view returns (uint256) {
        uint256 leaseBonus = _getLeaseBonus(user);
        uint256 communityBonus = _getCommunityBonus(user);
        return baseAmount * (rewardParams.baseRate + leaseBonus + communityBonus) / 10000;
    }

    // ========== 内部函数 ==========
    function _getLeaseBonus(address /*user*/) internal view returns (uint256) {
        // 根据实际租赁数据计算加成
         return rewardParams.maxLeaseBonus;  // 暂时返回配置的最大值
    }

    function _getCommunityBonus(address user) internal view returns (uint256) {
        uint256 score = communityScores[user];
        return score > rewardParams.communityMultiplier ? 
            rewardParams.communityMultiplier : score;
    }

    modifier whenFunctionActive(uint256 functionId) {
        require(!functionPaused[functionId], "Function paused");
        _;
    }
}

